import React, { useEffect, useState } from "react";
import { useNavigate } from 'react-router-dom'
import axios from "axios";

//https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist

function Home() {

  const navigate = useNavigate()

  const [users, setUsers] = useState()

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('register')
    }
  }, [])

  useEffect(() => {
    const res = axios.get("https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist")
    res.then((data) => setUsers(data.data))
  }, [])


  console.log('============= users', users)

  return <div>Home</div>
}

export default Home;
